COMMIT WORK;

update PRODUTO_COMPOSICAO A
set A.CUSTO_UNIT = (select coalesce(B.PRECO_CUSTO, 0)
                    from PRODUTO B
                    where B.CODIGO = A.id_matprima);

update PRODUTO_COMPOSICAO A
set A.custo_total = (a.qtde*a.custo_unit);

update PRECOCUSTO_HISTORICO P
set P.DATA_FIM = (select first 1 A.data
                  from PRECOCUSTO_HISTORICO A
                  where A.ID_PROD = p.id_prod and
                        A.ID > p.id)
order by p.id desc;

